Egypt in Crisis

Sociopolitical Documentary hosted by Charles Sennott, published by PBS broadcasted as part of PBS Frontline series in 2013 - English narration


Information
------------------------------

The inside story of a revolution gone wrong
Less than three years after the popular uprising that led to President Hosni Mubarak's ouster, and just one year after Egypt's first free and fair elections, the democratically elected government has been overthrown and the Egyptian military is running the state. And the Muslim Brotherhood--the secretive, long-outlawed Islamist group that came out of the shadows to win the presidency in June 2012--is once again being driven underground. Were the Brothers ever really in charge? Or was the Egyptian &quot;deep state&quot;--embedded remnants of Mubarak's police force, Supreme Court and, most of all, military--in control all along? In Egypt in Crisis, FRONTLINE and GlobalPost's Charles M. Sennott go inside the Egyptian revolution, tracing how what began as a youth movement to topple a dictator evolved into an opportunity for the Muslim Brotherhood to seemingly find the political foothold it had sought for decades--and then why it all fell apart. With Egypt's hopes for democracy in tatters, and the military-led government violently cracking down on the Brothers, what will happen next?

